import hello from '../../assets/imgs/Hello.svg'
const Main = () =>{
    return (
        <main>
            <div className='main__container'>
                <div className='main__title'>
                    <img src={hello} alt='hello'/>
                </div>
            </div>
        </main>
    )
}

export default Main
